import React, { Component } from 'react';
import './home.css';

class Home extends Component {
    state = {  }
    render() { 
        return ( 
            <React.Fragment>
                <div className="main">
                    <header class="main-banner">
                        <div class="container">
                            <div class="row">
                                <div class="col-lg-8 col-md-8">
                                    <div class="main-banner-content">
                                        <h1>Lettuce</h1>
                                        <p>Whatever You Need You Will Find It Here</p>

                                    </div>
                                </div>
                            </div>
                            <div className="row">
                                <div className="welcome">
                                    <h2>Welcome to Lettuce</h2>
                                </div>
                            </div>
                        </div>
                    </header>
                    </div>
            </React.Fragment>
     );
    }
}
 
export default Home;
